import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Badges from '../pages/Badges';
import BadgeNew from '../pages/BadgeNew';


/*nota en este caso creo una funcion no una clase el rerurn de esta funcion funciona como el render que creo dentro de una class */
function App() {
    return (
        <BrowserRouter>
            <Switch>
                <Route exact path='/bagdes' component={Badges} />
                <Route exact path='/bagdes/new' component={BadgeNew} />
            </Switch>
        </BrowserRouter>

    );
}
export default App;
